// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

contract Lottery {
    address public manager;
    uint256 public TicketPrice;
    uint256 public loteryId;


    mapping (address =>Ticket[] ) public Tickets;

    struct Ticket{
        uint256 tokenAdress;
        address buyer;
    }

}

